import React, {useState} from 'react'
import Axios from 'axios'

function Test() {

  const [data,setData] = useState([]);

  const getTest = () => {
    Axios.get("http://45.77.232.166:8080/get-pcos").then((response)=> {
      console.log(response);
      setData(response.data);
    })
  }

	let countriesList = data.length > 0
		&& data.map((item, i) => {
    
		return (
			<option key={i} value={item.id}>{item.name}</option>
		)
	}, this);

  return(
    <div>
      <button onClick={getTest}>Get Info</button>
      <select>
        {countriesList}
      </select>
    </div>
  );
}

export default Test;
